import React, { useEffect, useState } from 'react';
import { Table, Spin } from 'antd';
import { fetchBooks } from '../services/api';

const BookTable = () => {
    const [data, setData] = useState([]);
    const [loading, setLoading] = useState(true);
    const [pageSize, setPageSize] = useState(10);
    const [currentPage, setCurrentPage] = useState(1);

    useEffect(() => {
        const fetchData = async () => {
            setLoading(true);
            try {
                const result = await fetchBooks();
                setData(result);
            } catch (error) {
                console.error('Error fetching book data:', error);
            } finally {
                setLoading(false);
            }
        };
        fetchData();
    }, []);

    const columns = [
        { title: 'Ratings Average', dataIndex: 'ratings_average', key: 'ratings_average', sorter: (a, b) => a.ratings_average - b.ratings_average },
        { title: 'Author Name', dataIndex: 'author_name', key: 'author_name', sorter: (a, b) => a.author_name.localeCompare(b.author_name) },
        { title: 'Title', dataIndex: 'title', key: 'title', sorter: (a, b) => a.title.localeCompare(b.title) },
        { title: 'First Publish Year', dataIndex: 'first_publish_year', key: 'first_publish_year', sorter: (a, b) => a.first_publish_year - b.first_publish_year },
        { title: 'Subject', dataIndex: 'subject', key: 'subject', sorter: (a, b) => a.subject.localeCompare(b.subject) },
        { title: 'Author Birth Date', dataIndex: 'author_birth_date', key: 'author_birth_date', sorter: (a, b) => a.author_birth_date.localeCompare(b.author_birth_date) },
        { title: 'Author Top Work', dataIndex: 'author_top_work', key: 'author_top_work', sorter: (a, b) => a.author_top_work.localeCompare(b.author_top_work) },
    ];

    if (loading) {
        return <Spin />;
    }

    return (
        <Table
            dataSource={data}
            columns={columns}
            pagination={{
                current: currentPage,
                pageSize: pageSize,
                pageSizeOptions: ['10', '50', '100'],
                showSizeChanger: true,
                onChange: (page, pageSize) => {
                    setCurrentPage(page);
                    setPageSize(pageSize);
                },
            }}
            loading={loading}
            onChange={(pagination, filters, sorter) => {
                // Handle pagination, sorting, and filtering here
                console.log(pagination, filters, sorter);
            }}
        />
    );
};

export default BookTable;
